import React, { Component } from "react";
import "../CSS/donor.css";

export default class ShowDonors extends Component {
  state = {
    products: [],
  };
  componentDidMount = () => {
    this.getproducts();
    console.log(this.props.location.state.user);
  };
  getproducts = async () => {
    const token = sessionStorage.getItem("token");

    const config = {
      headers: {
        Authorization: `Bearer ${token}`,
        "Content-Type": "application/json",
      },
    };
    try {
      const res = await axios.get(
        `http://localhost:5000/api/v1/complaint`,
        config
      );
      this.setState({
        products: res.data.data,
      });
      console.log(res.data.data);
    } catch (err) {
      // console.log("Can't load the items");
    }
  };
  onDeleteUser = async (user, e) => {
    e.preventDefault();
    // console.log(user);
    const token = sessionStorage.getItem("token");
    const config = {
      headers: {
        Authorization: `Bearer ${token}`,
        "Content-Type": "application/json",
      },
    };

    try {
      await axios.delete(
        `http://localhost:5000/api/v1/complaint/${user}`,
        config
      );

      alert("Product Deleted");
    } catch (err) {
      console.log("Can't load the items");
    }
  };
  render() {
    return (
      <div>
        <section>
          <div id="portfolio">
            <div class="container showtop  login-second ">
              <div class="page-title text-center">
                <h1 class="text-dark">Complaints</h1>

                <hr class="pg-titl-bdr-btm" />
              </div>
              <div class="row">
                <div class="col-lg-12 ">{/* categotize */}</div>
              </div>

              <div class="row" id="" style={{ opacity: 1 }}>
                {/*  */}
                <div class="container pt-4">
                  <div class=" tabletrans ">
                    <div class="well">
                      <div class="row mb-5">
                        <div class="col-md-6">
                          <div class="pull-right">
                            <a
                              href="/farmer/addItems"
                              class="btn btn-info btn-sm p-2"
                            >
                              Add Complaints
                            </a>
                          </div>
                        </div>

                        <div class="pull-left">
                          <a href="/FHome" class="btn btn-info btn-sm p-2">
                            Back to Home
                          </a>
                        </div>
                      </div>
                      <table class="table table-hover">
                        <tr>
                          <th>
                            <label class="text-dark">Img</label>
                          </th>
                          <th>
                            {" "}
                            <label class="text-dark">Complaints </label>
                          </th>
                          <th>
                            {" "}
                            <label class="text-dark">Department</label>
                          </th>
                          <th>
                            {" "}
                            <label class="text-dark">Address</label>
                          </th>

                          <th>
                            {" "}
                            <label className="d-flex justify-content-center text-dark">
                              Actions
                            </label>
                          </th>
                        </tr>

                        <tr>
                          <td className="tbld">
                            <img
                              src="data:image/png;base64,"
                              alt=""
                              width="150px"
                              height="100px"
                            ></img>
                          </td>
                          <td className="tbld text-dark">2</td>
                          <td className="tbld text-dark">3</td>
                          <td className="tbld text-dark">g</td>

                          <td className="d-flex justify-content-center tbld">
                            <div className="btn-group ">
                              <a href="" class="btn btn-danger btn-md mr-5">
                                <i class="fa fa-trash-o"></i>
                              </a>

                              <a href="" class="btn btn-info btn-md">
                                <i class="fa fa-edit"></i>
                              </a>
                            </div>
                          </td>
                        </tr>

                        <tr>
                          <td className="tbld">
                            <img
                              src="data:image/png;base64,"
                              alt=""
                              width="150px"
                              height="100px"
                            ></img>
                          </td>
                          <td className="tbld text-dark">2</td>
                          <td className="tbld text-dark">3</td>
                          <td className="tbld text-dark">g</td>

                          <td className="d-flex justify-content-center tbld">
                            <div className="btn-group ">
                              <a href="" class="btn btn-danger btn-md mr-5">
                                <i class="fa fa-trash-o"></i>
                              </a>

                              <a href="" class="btn btn-info btn-md">
                                <i class="fa fa-edit"></i>
                              </a>
                            </div>
                          </td>
                        </tr>

                        <tr>
                          <td className="tbld">
                            <img
                              src="data:image/png;base64,"
                              alt=""
                              width="150px"
                              height="100px"
                            ></img>
                          </td>
                          <td className="tbld text-dark">2</td>
                          <td className="tbld text-dark">3</td>
                          <td className="tbld text-dark">g</td>

                          <td className="d-flex justify-content-center tbld">
                            <div className="btn-group ">
                              <a href="" class="btn btn-danger btn-md mr-5">
                                <i class="fa fa-trash-o"></i>
                              </a>

                              <a href="" class="btn btn-info btn-md">
                                <i class="fa fa-edit"></i>
                              </a>
                            </div>
                          </td>
                        </tr>

                        <tr>
                          <td className="tbld">
                            <img
                              src="data:image/png;base64,"
                              alt=""
                              width="150px"
                              height="100px"
                            ></img>
                          </td>
                          <td className="tbld text-dark">2</td>
                          <td className="tbld text-dark">3</td>
                          <td className="tbld text-dark">g</td>

                          <td className="d-flex justify-content-center tbld">
                            <div className="btn-group ">
                              <a href="" class="btn btn-danger btn-md mr-5">
                                <i class="fa fa-trash-o"></i>
                              </a>

                              <a href="" class="btn btn-info btn-md">
                                <i class="fa fa-edit"></i>
                              </a>
                            </div>
                          </td>
                        </tr>
                      </table>
                    </div>
                  </div>
                </div>
              </div>
            </div>
          </div>
        </section>
      </div>
    );
  }
}
